[[File:Supply crate (Mahogany Homes) detail.png|left|120px]]
A '''supply crate''' is a [[Mahogany Homes]] reward obtained from [[Amy]]'s [[Mahogany Homes Reward Shop|Rewards Shop]] for 25 [[Carpenter points]]. It contains various amounts of all kinds of materials used in training [[Construction]]. These crates are not intended to turn a profit, but are simply a way to help alleviate some of the costs of Construction.

==Possible loot==
{{DropsTableHead}}
{{DropsLineReward|name=Oak plank|quantity=28-30 (noted)|rarity=1/6}}
{{DropsLineReward|name=Teak plank|quantity=15-16 (noted)|rarity=1/6}}
{{DropsLineReward|name=Mahogany plank|quantity=6-7 (noted)|rarity=1/10}}
{{DropsLineReward|name=Steel bar|quantity=23-24 (noted)|rarity=1/6}}
{{DropsLineReward|name=Soft clay|quantity=45-48 (noted)|rarity=1/6}}
{{DropsLineReward|name=Bolt of cloth|quantity=9-15 (noted)|rarity=1/20}}
{{DropsLineReward|name=Limestone brick|quantity=9 (noted)|rarity=1/10}}
{{DropsTableBottom}}

